import React from "react";
const Voter = (props) => {
  return (
    <>
      <div>
          <div>{props.voterAddress}</div>
          <div>{props.name}</div>
          <div>{props.votingCardNumber}</div>
          <div>{ props.hasVerified ? (<p>verified</p>):(<button>Verify</button>)}</div>
      </div>
    </>
  );
};

export default Voter;
